import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	navBar: {
		backgroundColor: "#17202a",
		padding: "1rem 0",
	},
	logo: {
		position: "absolute",
		left: "10px",
	},
	navLinks: {
		color: "#f39c12",
	},
	toolBar: {
		display: "flex",
		justifyContent: "center",
	},
}));
